pragma solidity >=0.4.22 <0.8.0;

contract Election{
   // Model a Candidate
    struct Candidate {
        uint id;
        string name;
        uint voteCount;
    }

    event votedEvent (
        uint indexed _candidateId
    );

    mapping(address => bool) public voters; // maps address with a boolean for whether the account has voted

   mapping(uint => Candidate) public candidates; // Key-value pair of uint and candidate struct
   // This writes candidates to the blockchain

   uint public candidatesCount; // Counter for how many candidates there are in the mapping

   function addCandidate(string memory _name) private{ // Local variable has _ at the start
   		candidatesCount ++; 
   		candidates[candidatesCount] = Candidate(candidatesCount, _name, 0); // Adds new candidate to end of candidates mapping
   }

	constructor () public{
		// Constructor adds candidates whenever contract deployed
		addCandidate("Candidate 1");
		addCandidate("Candidate 2");
	}

	function vote (uint _candidateId) public{
		// require that they haven't voted before
        require(!voters[msg.sender]); // msg.sender gives us the account that sent the function call

        // require a valid candidate
        require(_candidateId > 0 && _candidateId <= candidatesCount);

        // record that voter has voted
        voters[msg.sender] = true;

        // update candidate vote Count
        candidates[_candidateId].voteCount ++;

        // trigger voted event
        emit votedEvent(_candidateId);
	}
}
